    false,nt"url": null,nt"notes": "This annual narrative report for Iroquois
    NWR outlines Refuge accomplishments during the 1975 fiscal year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and vegetation control. Resource management is
    outlined; topics include grazing, haying, fur harvesting, and timber removal. A
    progress report on field investigations and applied research is also provided. The
    public relations section of the report describes recreational uses, Refuge participation,
    hunting, and violations. The FY 1974 narrative is also included as an attachment.",nt"license_title":
